import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { MeasuringData } from './MeasuringData';

export const Stands = ({stationId}) =>{

const [stands, setStands] = useState([])
let standsList = []

useEffect(() => {

  axios.get(`/measuring-stands/${stationId}`)
  .then((res) => {
    setStands(res.data);
  })
},[]);

   standsList = stands.map(sta => {
    return (
      <div key={sta.id} >
      <p>{sta.name}</p>
      <p>{sta.code}</p>
        <MeasuringData standId={sta.id}/>
      </div>
    )
  })



  return(
    <div>
  {standsList}
  </div>
  )
}
